export default {
  name: 'University',
  data() {
    return {
      unidata: null
    };
  },
  mounted() {
    axios({
      method: 'get',
      url: "/university/",
      params: 'national-university-of-singapore'
    }).then(response => {
      if (response != null) {
        this.unidata = response;
      }
    }).catch(error => {
      alert(error.message);
    });
  }
};
